  const token = router.query.token;
  const tokenDecoded = jwt.decode(token);
  console.log(token);
  return (
    <Layout>
      {JSON.stringify(router)}
      <div>Activate Your Account</div>
    </Layout>
  );
};

export default withRouter(ActivateAccount);
